import "./Home__form.css"
import { useState, useEffect } from "react";


function Home__form() {
    const [inputs, setInputs] = useState({});

    const handleInputChange = (event) => {
        event.persist();
        setInputs(inputs => ({...inputs, [event.target.name]: event.target.value}));
      }
      const handleSubmit = (event) => {
        if (event) {
          event.preventDefault();
        }
        callback();
      }
    return (
        <div>
            <form action="" onSubmit={handleSubmit}>
                <div className="form__email">
                    <input type="email" name="email" id="email" placeholder="Enter email" value={inputs.email} onChange={handleInputChange} required />
                </div>
                <div className="form__password">
                    <input type="password" name="password" id="password" placeholder="Enter password" value={inputs.password1} onChange={handleInputChange} required />
                </div>
                <button type="submit" onSubmit>Login</button>
            </form>
        </div>
    )
}

export default Home__form
